import React from 'react';

const Rank = () => {
	return (
		<div>
			<div className='white f3'>
				{'Andrei, your current rank is...'}
			</div>
			<div className='white f1'>
				{'#5'}
				<br />
				<br />
			</div>
		</div>
	);
}

export default Rank;
